    const vote = (id) => {
    console.log('vote', id)
    dispatch(voteOf(id))
    }
    
    return (
        <div>
          <h2>Anecdotes</h2>
          {anecdotes.sort(byVotes).map(anecdote =>
            <div key={anecdote.id}>
              <div>
                {anecdote.content}
              </div>
              <div>
                has {anecdote.votes}
                <button onClick={() => vote(anecdote.id)}>vote</button>
              </div>
            </div>
          )}
        </div>
      )
}

